import React from "react";

function FormatNumber({ number, style, currency }) {
  return (
      new Intl.NumberFormat("mk-EN", {
        maximumFractionDigits: 2,
        minimumFractionDigits: 2,
        style: "decimal",
        currency,
      }).format(number)
  );
}

class Lokale extends React.Component {
  render() {
    return (
      <>
          <FormatNumber number={this.props.number} style={this.props.style} currency={this.props.currency} />
      </>
    );
  }
}

export default Lokale;
